import React, { Component } from 'react';
import PartnerCard from './partnercard';
import PARTNER_DATA from '../Data/PartnerData';

class PartnerList extends Component {
    constructor(props) {
        super(props);

        this.state = {
            partners : PARTNER_DATA
        }
    }
    render() {
        const { partners } = this.state;
        return (
            <div>
                <div className='md:ml-24 mt-4 text-teal-400 text-center text-bold text-4xl font-medium'> 
     Partners</div>
            <div className='md:flex md:ml-64 md:pl-24'>
               {partners.map(({name,number,id,imageUrl}) => (
                   <PartnerCard key={id} number={number} name={name} imageUrl={imageUrl}/>
               ))
               }
            </div>
            <div className='md:ml-24 mt-0 text-blue-500 text-center text-bold text-4xl font-medium'> 
     Or Mail us: rkec@airtelmail.in</div>
            </div>
        )
    }
}

export default PartnerList;
